var notes = [];

for(let i=0; response_body.length > i; i++) {
  if(response_body[i].note.private === false){
    notes.push(response_body[i].note);
  } else if(request_parameters.includePrivate) {
    notes.push(response_body[i].note);
  }
}

done({
  "continue": true,
 "response_body": notes
});

var expressionQuery = request_expression;
var where = request_parameters.where;
// if we don't have a WHERE query, then return / don't do anything
if (expressionQuery === null || expressionQuery === undefined) {
	done();
}
var filterString = "";
var stateString = "";
for (var i = 0; i < expressionQuery.length; i++) {
	var key = expressionQuery[i].attribute;
	var operator = expressionQuery[i].operator;
	var value = expressionQuery[i].value;
	if(operator != "=") {
	    done({
          "response_body": {
              "error": "Where supports only = operator"
          },
          "response_status_code": 400,
          "continue": false
        })
	}
	if (expressionQuery.length > 1)	{
		if(key.toLowerCase()!="state") {
		  filterString +=  key +" is "+value;
		  {i === 0 ?  filterString += checkAndOr(where) : ""}
		} else {
		  stateString +=  value;
		}
	} else {
		if(key.toLowerCase()!="state") {
			filterString +=  key +" is "+value;
		} else {
			stateString +=  value;
		}
	}
}
let map = {};
map.query = filterString;
map.state = stateString;
done({
	"request_vendor_parameters": map
});


function checkAndOr(whereQuery) {
	if (whereQuery.toLowerCase().indexOf("and") > -1) {
		return " and ";
	}
	return "";
}
